import React , {Fragment} from 'react';
import spinner from './spinner.gif'

export default function Spinner() {
    return (
        <Fragment>
            <img
            src = {spinner}
            style = {{ width: '200px' , margin: 'auto' }}
            alt = 'Loading...'
            />
        </Fragment>
    )
}
